import './App.css';
import tag from './assets/img/tag.svg';

function App() {
  return (
    <div className="App">
      <img src={tag} alt='tag' /> 
      <h1>Rafael <span>dev</span></h1>
      <p>HTML . CSS . JS . REACT . REACT NATIVE . REDUX </p>
    </div>
  );
}

export default App;
